"use client";

import { useState } from "react";
import { Send, Target } from "lucide-react";
import {
  Tabs,
  TabsContent,
  TabsList,
  TabsTrigger,
} from "@/components/ui/tabs";
import {
  Card,
  CardContent,
  CardDescription,
  CardFooter,
  CardHeader,
  CardTitle,
} from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import React from "react";

interface Goal {
  code: string;
  raster: string;
  question: string;
  description: string | null;
  type: string | null;
}

interface Message {
  text: string;
  isUser: boolean;
}

export default function LIDA() {
  const [messages, setMessages] = useState<Message[]>([
    {
      text: "Hello! I'm LIDA, your power grid analysis assistant. How can I help you today?",
      isUser: false,
    },
  ]);
  const [loading, setLoading] = useState(false);
  const [selectedGoalResponse, setSelectedGoalResponse] = useState<{
    text: string;
    imageUrl: string;
  } | null>(null);
  const [selectedGoal, setSelectedGoal] = useState<Goal | null>(null);
  const [input, setInput] = useState("");

  const goals: Goal[] = [
    {
      "code": "import seaborn as sns\nimport pandas as pd\nimport matplotlib.pyplot as plt\n\ndef plot(data: pd.DataFrame):\n    sns.lineplot(x='Timestamp', y='Battery_Active_Power', data=data)\n    plt.title('Battery Active Power over Time')\n    return plt\n\nchart = plot(data)",
      "description": null,
      "question": "What is the trend of the battery active power over time?",
      "raster": "",
      "type": null
    },
    {
      "code": "import seaborn as sns\nimport pandas as pd\nimport matplotlib.pyplot as plt\n\ndef plot(data: pd.DataFrame):\n    sns.lineplot(x='Timestamp', y='totalSolarEnergyGeneration', data=data)\n    plt.title('Total Solar Energy Generation over Time')\n    return plt\n\nchart = plot(data)",
      "description": null,
      "question": "What is the trend of total solar energy generation over time?",
      "raster": "",
      "type": null
    },
    {
      "code": "import seaborn as sns\nimport pandas as pd\nimport matplotlib.pyplot as plt\n\ndef plot(data: pd.DataFrame):\n    sns.scatterplot(x='Demand', y='Supply', data=data)\n    plt.title('Demand vs Supply')\n    return plt\n\nchart = plot(data)",
      "description": null,
      "question": "What is the relationship between 'Demand' and 'Supply' in the given data, and can it be visualized in a scatterplot?",
      "raster": "",
      "type": null
    },
    {
      "code": "import seaborn as sns\nimport pandas as pd\nimport matplotlib.pyplot as plt\n\ndef plot(data: pd.DataFrame):\n    sns.boxplot(x='Island_mode_MCCB_Active_Power', data=data)\n    plt.title('Distribution of Island Mode MCCB Active Power')\n    return plt\n\nchart = plot(data)",
      "description": null,
      "question": "What is the distribution of the \"Island Mode MCCB Active Power\" in the provided data?",
      "raster": "",
      "type": null
    },
    {
      "code": "import seaborn as sns\nimport pandas as pd\nimport matplotlib.pyplot as plt\n\ndef plot(data: pd.DataFrame):\n    sns.histplot(data['GE_Active_Power'], kde=True)\n    plt.title('GE Active Power Distribution')\n    return plt\n\nchart = plot(data)",
      "description": null,
      "question": "What is the distribution of GE Active Power in the provided dataset, represented visually?",
      "raster": "",
      "type": null
    },
    {
      "code": "import seaborn as sns\nimport pandas as pd\nimport matplotlib.pyplot as plt\n\ndef plot(data: pd.DataFrame):\n    sns.barplot(x='totalWindEnergyGeneration', y='totalGasEnergyGeneration', data=data)\n    plt.title('Total Wind vs Gas Energy Generation')\n    return plt\n\nchart = plot(data)",
      "description": null,
      "question": "What is the comparison between total wind energy generation and total gas energy generation as presented in a bar plot?",
      "raster": "",
      "type": null
    }
  ]

  const handleGoalClick = (goal: Goal) => {
    setSelectedGoal(goal);
    setLoading(true);
    setSelectedGoalResponse(null);

    setTimeout(() => {
      const responseText = `${goal.question}.`;
      const imageUrl = `data:image/png;base64,${goal.raster.replace(/^data:image\/png;base64,/, "")}`;

      setMessages((prev) => [...prev, { text: responseText, isUser: false }]);
      setSelectedGoalResponse({ text: "", imageUrl });
      setLoading(false);
    }, 1500);
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();

    if (!input.trim()) return;

    setMessages((prev) => [...prev, { text: input, isUser: true }]);

    setTimeout(() => {
      setMessages((prev) => [
        ...prev,
        {
          text: "I'm analyzing your request about the power grid. This is a placeholder response that would normally come from the AI system.",
          isUser: false,
        },
      ]);
    }, 1000);

    setInput("");
  };

  return (
    <Tabs
      defaultValue="goals"
      className="container mx-auto h-[calc(100vh-4rem)] flex flex-col"
    >
      <TabsList className="w-full justify-center mt-4 space-x-4">
        <TabsTrigger
          value="goals"
          className="w-48 h-12 font-bold text-lg data-[state=active]:bg-blue-500 data-[state=active]:text-white"
        >
          <div className="flex items-center">
            <Target className="mr-2 h-4 w-4" />
            Goals
          </div>
        </TabsTrigger>
        <TabsTrigger
          value="visualization"
          className="w-48 h-12 font-bold text-lg data-[state=active]:bg-blue-500 data-[state=active]:text-white"
        >
          Visualization Playground
        </TabsTrigger>
      </TabsList>

      <TabsContent
        value="goals"
        className="p-6 flex-1 overflow-y-auto bg-white text-black"
      >
        <div className="space-y-4">
          <h2 className="text-xl font-semibold">
            <div className="flex items-center">
              <Target className="mr-2 h-4 w-4" />
              Goals from LIDA LLM about the dataset:
            </div>
          </h2>
          <div className="flex flex-col gap-4">
            {goals.map((goal, index) => (
              <Card
                key={index}
                className="cursor-pointer hover:shadow-md transition-shadow duration-300"
                onClick={() => handleGoalClick(goal)}
              >
                <CardHeader>
                  <CardTitle className="text-lg">{goal.question}</CardTitle>
                </CardHeader>
                {selectedGoal?.code === goal.code && selectedGoalResponse && (
                  <CardContent>
                    <div className="flex flex-col items-center">
                      <img
                        src={selectedGoalResponse.imageUrl}
                        alt="Goal Visualization"
                        className="w-128 h-128 cursor-pointer"
                        onClick={() =>
                          window.open(selectedGoalResponse.imageUrl, "_blank")
                        }
                      />
                    </div>
                  </CardContent>
                )}
              </Card>
            ))}
          </div>
        </div>
      </TabsContent>

      <TabsContent
        value="visualization"
        className="relative flex-1 flex flex-col overflow-hidden bg-white"
      >
        <div className="absolute inset-0 flex items-center justify-center pointer-events-none z-0">
          <h1 className="text-8xl font-bold text-gray-700 opacity-30">
            Playground
          </h1>
        </div>
        <div className="p-6 shadow-sm relative z-10">
          <h1 className="text-2xl font-bold text-gray-800">Analysis Point (LIDA)</h1>
          <p className="text-gray-500 mt-1">
            Your intelligent power grid analysis assistant
          </p>
        </div>

        {loading && (
          <div className="absolute inset-0 flex items-center justify-center bg-white/70 z-20">
            <div className="animate-spin rounded-full h-16 w-16 border-t-4 border-blue-500"></div>
          </div>
        )}

        <div className="flex-1 p-6 overflow-y-auto relative z-10">
          <div className="max-w-3xl mx-auto space-y-4">
            {messages.map((message, index) => (
              <div
                key={index}
                onContextMenu={(e) => {
                  e.preventDefault();
                  console.log("Right-click on message:", message.text);
                }}
                className={`flex ${
                  message.isUser ? "justify-end" : "justify-start"
                }`}
              >
                <div
                  className={`max-w-sm p-4 rounded-lg ${
                    message.isUser
                      ? "bg-blue-500 text-white"
                      : "bg-gray-300 text-black"
                  }`}
                >
                  {message.text}
                </div>
              </div>
            ))}
          </div>
        </div>

        <div className="p-6 bg-white border-t">
          <form
            onSubmit={handleSubmit}
            className="max-w-3xl mx-auto flex gap-4"
          >
            <input
              type="text"
              value={input}
              onChange={(e) => setInput(e.target.value)}
              placeholder="Ask about power grid analysis..."
              className="flex-1 p-3 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
            <button
              type="submit"
              className="px-6 py-3 bg-blue-500 text-white rounded-lg hover:bg-blue-600 transition-colors flex items-center gap-2"
            >
              <Send size={20} />
              Send
            </button>
          </form>
        </div>
      </TabsContent>
    </Tabs>
  );
}
